import classes from './NavBar.module.css'



function NavBar ()  {
    return(
        <div className= {classes.layout}>
       <div className={classes.title}>Crypto Fervor</div>
       <ul>
           <li>Fervor?</li>
           <li>Watchlist</li>
           <li>About us</li>
       </ul>

        </div>
    ) ;

};


export default NavBar;
